import React from 'react';
import Header from '../components/Header';

const PatientInfoPage = () => {
  return (
    <>
      <Header />
      <div style={{ textAlign: 'center', marginTop: '100px' }}>
        <h2>환자 정보 페이지</h2>
      </div>
    </>
  );
};

export default PatientInfoPage;
